import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';


function Adoptables(){
    return (
    <div className="adoptables">
    <Container >
    <Row className="text-adopt">
    <Col><h1 >ADOPTABLE DOGS</h1></Col>
    <Col><h1 >|</h1></Col>
    <Col><h1 >ADOPTABLE CATS</h1></Col>
  </Row>
  </Container>
    </div>
    )
}
export default Adoptables;
